CREATE TABLE `clients` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `chinese_name` varchar(255) DEFAULT NULL,
  `english_name` varchar(255) DEFAULT '',
  `person_id` int(11) NOT NULL DEFAULT '0',
  `address_1` varchar(255) DEFAULT NULL,
  `person1` varchar(50) DEFAULT NULL,
  `person2` varchar(50) DEFAULT NULL,
  `address_2` varchar(255) DEFAULT NULL,
  `city_1` varchar(255) DEFAULT NULL,
  `city_2` varchar(255) DEFAULT NULL,
  `state_1` varchar(255) DEFAULT NULL,
  `state_2` varchar(255) DEFAULT NULL,
  `country_1` varchar(100) DEFAULT NULL,
  `country_2` varchar(100) DEFAULT NULL,
  `postalcode_1` varchar(20) DEFAULT NULL,
  `postalcode_2` varchar(20) DEFAULT NULL,
  `title_1` varchar(50) DEFAULT NULL,
  `title_2` varchar(50) DEFAULT NULL,
  `gender1_id` int(11) DEFAULT NULL,
  `gender2_id` int(11) DEFAULT NULL,
  `mobile_1` varchar(20) DEFAULT NULL,
  `mobile_2` varchar(20) DEFAULT NULL,
  `tel_1` varchar(30) DEFAULT NULL,
  `tel_2` varchar(30) DEFAULT NULL,
  `fax_1` varchar(20) DEFAULT NULL,
  `fax_2` varchar(20) DEFAULT NULL,
  `email_1` varchar(255) DEFAULT NULL,
  `email_2` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  `status_id` int(11) DEFAULT NULL,
  `region_id` int(11) DEFAULT NULL,
  `industry_id` int(11) DEFAULT NULL,
  `client_code` varchar(10) NOT NULL DEFAULT '',
  `person3` varchar(50) NOT NULL DEFAULT '',
  `title_3` varchar(50) NOT NULL DEFAULT '',
  `gender3_id` int(11) NOT NULL DEFAULT '0',
  `mobile_3` varchar(20) NOT NULL DEFAULT '',
  `tel_3` varchar(20) NOT NULL DEFAULT '',
  `fax_3` varchar(20) NOT NULL DEFAULT '',
  `email_3` varchar(50) NOT NULL DEFAULT '',
  `created_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_on` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `client_id` (`person_id`,`gender1_id`,`gender2_id`,`category_id`,`status_id`,`region_id`,`industry_id`,`gender3_id`),
  KEY `client_code` (`client_code`)
) ENGINE=MyISAM AUTO_INCREMENT=540 DEFAULT CHARSET=utf8;
